DELIMITER $$
CREATE TRIGGER `actualizar_stock` AFTER INSERT ON `pedidos` FOR EACH ROW BEGIN
    DECLARE cantidad_stock INT;
    SELECT stock INTO cantidad_stock FROM productos WHERE id = NEW.producto_id;

    IF cantidad_stock >= NEW.cantidad THEN
        UPDATE productos
        SET stock = stock - NEW.cantidad
        WHERE id = NEW.producto_id;
    ELSE
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No hay suficiente stock para este producto';
    END IF;
END
$$
DELIMITER ;

